
/* static variables:
 *      animal_types {level : [types]}
 *      animal_names [names]
 *      animal_urls [urls]
 */
export class Animal {
    name: string = "";
    level: number = 0;
    type: string = ""; 
    imgUrl: string = "";
  
    constructor(l: number, t: string){
      this.name = animal_names[Math.floor(Math.random() * 246)]
      this.level = l;
      this.type = t;
      this.imgUrl = animal_urls[t];
    }
}

